import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <table width={1000} border={1}>
        <thead>
          <tr>
            <th>이수</th>
          </tr>
          <tr>필수</tr>
          <tr>과목명</tr>
          <tr>학점</tr>
          <tr>출석점수</tr>
          <tr>과제점수</tr>
          <tr>중간고사</tr>
          <tr>기말고사</tr>
          <tr>총점</tr>
          <tr>평균</tr>
          <tr>성적</tr>
        </thead>
      </table>
    </div>
  );
}

export default App;
